$.aFD=A.a(["21 Mart - 20 Nisan \n\n Elementi: Ate\u015f \n\n Niteli\u011fi: \xd6nc\xfc \n\n Gezegeni: Mars \n\n Rengi: K\u0131rm\u0131z\u0131 \n\n Ta\u015f\u0131: Elmas \n\n G\xfcn\xfc: Sal\u0131 \n\n Bu burcun etkisi alt\u0131nda do\u011fan ki\u015filer ya\u015famay\u0131 seven, co\u015fkulu, giri\u015fken yap\u0131ya sahiptir.Yeni \u015feyleri \xf6\u011frenmeye kar\u015f\u0131 \xe7ok heveslidirler. Yarat\u0131c\u0131 bir meraka sahiptirler. \u0130lgilendikleri konuda \xfcretken olduklar\u0131 kadar yapt\u0131klar\u0131n\u0131n ba\u015fkalar\u0131 taraf\u0131ndan onaylanmas\u0131 da onlar i\xe7in \xf6nem ta\u015f\u0131r.Heyecanl\u0131 yap\u0131lar\u0131 y\xfcz\xfcnden \xe7abuk hareket eden, pratik tiplerdir. En zor ko\u015fullara bile katlanabilen sava\u015f\xe7\u0131 nitelikleri vard\u0131r.\u0130stediklerini elde edemezler ya da yanl\u0131\u015f anla\u015f\u0131l\u0131rlarsa kolayca \xf6fkelenebilirler. Ancak \xf6fkeleri saman alevi gibi \xe7abuk ge\xe7er. Kin tutmazlar ve hatalar\u0131n\u0131 anlad\u0131klar\u0131 zaman kalpleri kazanmak i\xe7in her \u015feylerini verebilirler.","21 Nisan - 21 May\u0131s \n\n Elementi: Toprak \n\n Niteli\u011fi: Sabit \n\n Gezegeni: Ven\xfcs \n\n Rengi: Toprak renkler, taba, bej, kahve, ye\u015fil \n\n Ta\u015f\u0131: Z\xfcmr\xfct \n\n G\xfcn\xfc: Cuma \n\n Kararl\u0131 ve g\xfcven vericidir. Zevk sahibi olmas\u0131, bar\u0131\u015fa ve uyuma \xf6nem vermesi en iyi \xf6zellikleridir.  Fiziksel a\xe7\u0131dan g\xfc\xe7l\xfcd\xfcr. Verimli ve ortakla\u015fa \xe7al\u0131\u015fmalarda yarat\u0131c\u0131d\u0131r.Ancak Bo\u011fa\u2019n\u0131n  \u0130nat\xe7\u0131l\u0131\u011f\u0131 ve ak\u0131ls\u0131zca direni\u015fi zay\u0131f y\xf6n\xfcd\xfcr. Bu durum k\u0131skan\xe7l\u0131k s\xf6z konusu oldu\u011funda ili\u015fkilerde kilitlenme yaratabilir. Yeteri kadar yarat\u0131c\u0131 ve esnek d\xfc\u015f\xfcnemeyebilir. Daha fazla esnekli\u011fe ve hayal g\xfcc\xfcne ihtiyac\u0131 vard\u0131r. Sabitli\u011fi y\xfcz\xfcnden kendini geli\u015ftirmekte zorlanabilir.","22 May\u0131s - 22 Haziran \n\n Elementi: Hava \n\n Niteli\u011fi: De\u011fi\u015fken \n\n Gezegeni: Merk\xfcr \n\n Rengi: Sar\u0131, turuncu \n\n Ta\u015f\u0131: Agat \n\n G\xfcn\xfc: \xc7ar\u015famba \n\n \u0130kizler bur\xe7lar\u0131 \xe7ok y\xf6nl\xfc ve renkli bir ki\u015fili\u011fe sahiptir. \xd6\u011frenmek onun i\xe7in nefes almak gibidir. Dura\u011fanl\u0131\u011fa dayanamaz, kolay s\u0131k\u0131l\u0131r. \u0130kna yetene\u011fine sahip oldu\u011fu gibi \xe7ok esprilidir. Haz\u0131rcevap ve muziptir, e\u011flendiricidir.Ara\u015ft\u0131rmaya merakl\u0131d\u0131rlar. Konu\u015fmalar\u0131, terbiyeli tav\u0131r ve davran\u0131\u015flar\u0131 ile kendilerini kolayca sevdirirler. Zor zamanlarda dahi \xe7\xf6z\xfcm \xfcreten, yarat\u0131c\u0131 ki\u015filerdir. Duygular\u0131n\u0131 s\xf6zlerle ifade etmek, duygular\u0131 akl\u0131n s\xfczgecinden ge\xe7irmek \u0130kizler i\xe7in son derece al\u0131\u015f\u0131lm\u0131\u015f bir durumdur.","23 Haziran - 22 Temmuz \n\n Elementi: Su \n\n Niteli\u011fi: \xd6nc\xfc \n\n Gezegeni: Ay \n\n Rengi: Mavi \n\n Ta\u015f\u0131: \u0130nci \n\n G\xfcn\xfc: Pazartesi \n\n Yenge\xe7 bur\xe7lar\u0131 \xe7ocuk gibi yumu\u015fak, duygusal a\xe7\u0131dan besleyen ve beslenen bir yap\u0131dad\u0131r. Duygularla hareket eder ve sevdiklerini \xe7ok korur, onlara kalbinde \xf6zel bir yer a\xe7ar. Son derece koruyucudur.Duygusal durumu s\xfcrekli de\u011fi\u015fim i\xe7inde oldu\u011fu i\xe7in kolayca depresif olabilir, kendini olumsuz duygulardan kurtarmas\u0131 ve g\xfcven kazanmas\u0131 uzun zaman alacakt\u0131r. D\u0131\u015far\u0131 kar\u015f\u0131 sert bir g\xf6r\xfcn\xfcm sergileseler de, hassas ve koruyucu bir do\u011falar\u0131 vard\u0131r. Sorumluluk duygusu geli\u015fmi\u015f, sa\u011fduyulu ve sab\u0131rl\u0131 tiplerdir. Tart\u0131\u015fma anla\u015fmazl\u0131klardan ho\u015flanmazlar.","23 Temmuz - 22 Agustos \n\n Elementi: Ate\u015f \n\n Niteli\u011fi: Sabit \n\n Gezegeni: G\xfcne\u015f \n\n Rengi: Alt\u0131n, turuncu \n\n Ta\u015f\u0131: Yakut \n\n G\xfcn\xfc: Pazar \n\n Aslan bur\xe7lar\u0131 y\xfcce g\xf6n\xfcll\xfc ve \xf6ne \xe7\u0131kan karakterleri ile di\u011fer bur\xe7lardan ayr\u0131l\u0131rlar. Y\xf6netmeyi ve her zaman odak noktas\u0131 olmay\u0131 severler. Bazen ise bir \xe7ocuk gibi oyuncu ve hayat\u0131 seven ve bunu yans\u0131tan bir karakteri vard\u0131r.Ba\u015fkalar\u0131na ilham veren, etkileyici, iyimser, g\xfclery\xfczl\xfc, hareketli, g\xfcne\u015f gibi \xe7evresine \u0131\u015f\u0131k sa\xe7an s\u0131cak tiplerdir. M\xfccadele ederken her zaman d\xfcr\xfcst ve mert\xe7e davran\u0131r, kurnazl\u0131k d\xfc\u015f\xfcnmezler. Ba\u011f\u0131\u015flay\u0131c\u0131 olmalar\u0131na kar\u015f\u0131n bazen a\u015f\u0131r\u0131 gururlar\u0131n\u0131n etkisi alt\u0131nda kalabilirler.L\xfckse ve ihti\u015fama d\xfc\u015fk\xfcnd\xfcrler. A\u015f\u0131r\u0131 gururlar\u0131 bazen kendilerini olduklar\u0131nda daha y\xfcksekte g\xf6rmelerine de sebep olabilir.","23 A\u011fustos - 22 Eyl\xfcl \n\n Elementi: Toprak \n\n Niteli\u011fi: De\u011fi\u015fken \n\n Gezegeni: Merk\xfcr \n\n Rengi: Sar\u0131 \n\n Ta\u015f\u0131: Akik \n\n G\xfcn\xfc: \xc7ar\u015famba \n\n Ba\u015fak bur\xe7lar\u0131 \xe7al\u0131\u015fkan, d\xfczenli ve pratik insanlard\u0131r. D\xfczen, sistem ve organizasyon onlar i\xe7in \xe7ok \xf6nemlidir. Organizasyon konusunda onlar\u0131n \xfcst\xfcne yoktur. Ayr\u0131nt\u0131lara dikkat ederler.M\xfckemmeliyet\xe7i bir yap\u0131lar\u0131 oldu\u011fu gibi, bazen bu sebeple \xe7evrelerine kar\u015f\u0131 a\u015f\u0131r\u0131 ele\u015ftirici de davranabilirler. Ara\u015ft\u0131rmac\u0131 ve \xf6\u011frenmeyi seven bir yap\u0131lar\u0131 vard\u0131r. \xc7o\u011funlukla ger\xe7ek\xe7i ve elle tutulur sonu\xe7lara g\xfcvenirler. Sorgulay\u0131c\u0131 ve inceleyicidir.Zekas\u0131 ve mizahi taraf\u0131 ile son derece e\u011flenceli ki\u015fileddir.","23 Eyl\xfcl - 22 Ekim \n\n Elementi: Hava \n\n Niteli\u011fi: \xd6nc\xfc \n\n Gezegeni: Ven\xfcs \n\n Rengi: Mavi, pembe \n\n Ta\u015f\u0131: Safir \n\n G\xfcn\xfc: Cuma \n\n Terazi burcu denge ve adalet burcu olarak bilinir. Teraziler \xe7evrelerinde uyum ve bar\u0131\u015f\xe7\u0131l bir atmosfer yaratma konusunda yeteneklidirler. Terazi burcu kendisinden \xf6nce ba\u015fkalar\u0131na odaklanabilen bir bur\xe7tur. \u0130\u015fbirli\u011fine, ortakl\u0131klara her zaman a\xe7\u0131k durabilirler. \u0130deal e\u015fler ve ortaklard\u0131r. Yaln\u0131z kalmak onlara g\xf6re de\u011fildir. Karars\u0131z kalmak  ve s\xfcrekli bir denge bulamamak zay\u0131f yanlar\u0131n\u0131 olu\u015fturur. Ba\u015fkalar\u0131n\u0131n fikirlerinde kolayca etkilenebilirler. Teraziler iyi kalpli ve g\xfcvenilir insanlard\u0131r. Her\u015feyin bar\u0131\u015f denge ve uyum i\xe7inde oldu\u011fu, adil bir d\xfcnya ararlar.","23 Ekim - 21 Kas\u0131m \n\n Elementi: Su \n\n Niteli\u011fi: Sabit \n\n Gezegeni: Mars \n\n Rengi: Bordo \n\n Ta\u015f\u0131: Opal \n\n G\xfcn\xfc: Sal\u0131 \n\n Akrep burcu a\u015f\u0131r\u0131 u\xe7lar\u0131 ya\u015fayabilen \xe7\xf6z\xfcmlenmesi zor bir bur\xe7tur. Bu burcun insan\u0131 fiziksel oldu\u011fu kadar derin bir i\xe7sel g\xfcce sahiptir. Sezgileri g\xfc\xe7l\xfcd\xfcr. Bir insan ya da bir olay\u0131 bir bak\u0131\u015fta derinlemesine kavrayabilirler. Kimi zaman d\xfc\u015f\xfcncelerini patavats\u0131z \u015fekilde s\xf6yleyerek k\u0131r\u0131c\u0131 olabilirler. \xd6fkelendiklerinde ac\u0131 konu\u015furlar ve kar\u015f\u0131lar\u0131ndakinin hi\xe7 akl\u0131na gelmeyen zay\u0131f yanlar\u0131n\u0131 bir \xe7\u0131rp\u0131da d\xf6k\xfcverirler. Ancak yine de akrep insan\u0131 kilitli bir kutu gibidir ve kendi hakk\u0131nda bilinmesini istemedi\u011fi \u015feyleri gizlemekte ustad\u0131r. Akrepler en zor olaylardan sonra dahi kendilerini yenilebilme g\xfcc\xfcne sahiptir. Ya\u015fam\u0131n anlam\u0131, \xf6l\xfcm ve \xf6l\xfcmden sonras\u0131 gibi konular do\u011fal ilgi alan\u0131d\u0131r.","22 Kas\u0131m - 21 Aral\u0131k \n\n Elementi: Ate\u015f \n\n Niteli\u011fi: De\u011fi\u015fken \n\n Gezegeni: J\xfcpiter \n\n Rengi: Eflatun \n\n Ta\u015f\u0131: Topaz \n\n G\xfcn\xfc: Per\u015fembe \n\n Yay burcu iyimserlik ve yeniliklere a\xe7\u0131kl\u0131klar\u0131 ile tan\u0131n\u0131rlar. Ya\u015fama kar\u015f\u0131 co\u015fkulu ve idealist ki\u015filerdir. Kavray\u0131\u015flar\u0131 g\xfc\xe7l\xfc oldu\u011fu i\xe7in felsefi konularda ba\u015far\u0131l\u0131 olurlar. Gezmeyi, seyahati, farkl\u0131 yerler g\xf6r\xfcp farkl\u0131 k\xfclt\xfcrler tan\u0131may\u0131 \xe7ok severler. Yerlerinde duramayan de\u011fi\u015fiklik yapmay\u0131 seven tiplerdir. Yay ayn\u0131 zamanda de\u011fi\u015fken bir bur\xe7tur ve bu de\u011fi\u015fkenlikleri onlara davran\u0131\u015flar\u0131nda tutars\u0131zl\u0131k getirebilir. Kolayca karas\u0131zl\u0131k ya\u015fayabilirler.\xc7o\u011funlukla idealist yap\u0131da olduklar\u0131 i\xe7in \xf6\u011frenmeye, \xf6\u011frendiklerini pratik etmeye ve kendilerini geli\u015ftirmeye \xe7al\u0131\u015f\u0131rlar. Ancak \xe7ok kolayca s\u0131k\u0131l\u0131p yeni bir yol izlemeye de ba\u015flayabilirler.Yay burcu aray\u0131\u015f i\xe7inde bir bur\xe7tur. Ger\xe7e\u011fi, bilgiyi ve bilgeli\u011fi ararlar. G\xfc\xe7l\xfc bir do\u011fru- yanl\u0131\u015f anlay\u0131\u015flar\u0131 vard\u0131r. Hayatlar\u0131nda bu do\u011frulara uygun ya\u015famaya \xe7al\u0131\u015fan adil, ahlakl\u0131 ve erdemli ki\u015filer yaylardan \xe7\u0131kar. \u0130nan\xe7lar\u0131 g\xfc\xe7l\xfcd\xfcr. \u0130yi konu\u015fmac\u0131d\u0131rlar.","2 Aral\u0131k - 21 Ocak \n\n Elementi: Toprak \n\n Niteli\u011fi: \xd6nc\xfc \n\n Gezegeni: Sat\xfcrn \n\n Rengi: Kahverengi, siyah \n\n Ta\u015f\u0131: Ametist \n\n G\xfcn\xfc: Cumartesi \n\n O\u011flak bur\xe7lar\u0131 ciddi, g\xfcvenilir, sorumluluk sahibi olmalar\u0131 ve y\u0131lmadan \xe7al\u0131\u015fmalar\u0131 ile tan\u0131n\u0131rlar. Geli\u015fmi\u015f bir g\xf6rev duygular\u0131 vard\u0131r. \xc7ok gen\xe7 ya\u015ftan itibaren omuzlar\u0131na sorumluluk y\xfcklenmeye ve \xe7al\u0131\u015fmaya ba\u015flayabilirler. Ancak \xe7ok iyi birer i\u015f adam\u0131-kad\u0131n\u0131 olabilirler. Y\xf6neticilik yetenekleri \xe7ok geli\u015fmi\u015ftir.O\u011flaklar \xe7ok disiplinlidir. Hedeflerine ula\u015fmak i\xe7in y\u0131lmadan \xe7al\u0131\u015f\u0131rlar. Kolay kolay gev\u015feyemeyen bir yap\u0131lar\u0131 vard\u0131r. Kolayca g\xfcvensizli\u011fe, karamsarl\u0131\u011fa kap\u0131labilirler. Ciddi tiplerdir. Fiziksel g\xf6r\xfcn\xfcmleri, ya\u015flansalar dahi gen\xe7 kald\u0131\u011f\u0131 gibi, edindikleri deneyimlerin \u0131\u015f\u0131\u011f\u0131nda ya\u015fland\u0131k\xe7a bilgele\u015ferek \xe7ocuklar gibi sadele\u015febilirler.Genellikle duygular\u0131n\u0131 g\xf6stermeyen, derinlerde ya\u015fayan, maddi g\xfcvenli\u011fe \xf6nem veren insanlard\u0131r. Maddi durumlar\u0131 iyi de\u011filse kolayca endi\u015felenip, kendilerine olan g\xfcvenlerini yitirebilirler.Utanga\xe7l\u0131klar\u0131 ve i\xe7e kapan\u0131k olmalar\u0131 veya i\u015fleriyle fazlaca me\u015fgul olmalar\u0131 sebebiyle kolay arkada\u015f edinemeyen tiplerdir. ","22 Ocak - 19 Subat \n\n Elementi: Hava \n\n Niteli\u011fi: Sabit \n\n Gezegeni: Sat\xfcrn \n\n Rengi: Mavi ye\u015fil \n\n Ta\u015f\u0131: Akuamarin \n\n G\xfcn\xfc: Cumartesi \n\n Kova bur\xe7lar\u0131 h\xfcmanist, insanl\u0131k i\xe7in \xe7al\u0131\u015fmalar yapan, toplumsal meselelerle ilgilenen ve ayn\u0131 zamanda yenilik\xe7i ve idealist ki\u015filerdir. Ak\u0131lc\u0131 olduklar\u0131 i\xe7in sadece hayal kurmakla kalmaz ideallerini ger\xe7e\u011fe d\xf6n\xfc\u015ft\xfcrmek i\xe7in organizasyonlar\u0131n i\xe7inde olmay\u0131 tercih ederler. Genellikle g\xf6r\xfc\u015fleri \xe7a\u011f\u0131n\u0131n \xf6tesinde ve sezgiseldir. Hayata bilim adam\u0131 gibi yakla\u015fmay\u0131 ve objektif bakmay\u0131 severler. Bu y\xfczden kovalarla yak\u0131nla\u015fmak kolay de\u011fildir. Her \u015feye ra\u011fmen insanlarla aralar\u0131na mesafe koymay\u0131 severler. Orijinal fikirler hep kovalardan \xe7\u0131kar. Daha \xe7ocuk ya\u015ftan itibaren yarat\u0131c\u0131, farkl\u0131 ve zaman zaman asidirler.","20 Subat - 20 Mart \n\n Elementi: Su \n\n Niteli\u011fi: De\u011fi\u015fken \n\n Gezegeni: J\xfcpiter \n\n Rengi: Beyaz, lavanta \n\n Ta\u015f\u0131: Ay ta\u015f\u0131 \n\n G\xfcn\xfc: Per\u015fembe \n\n Bal\u0131k insan\u0131 son derece merhametli, uysal ve vicdan sahibi olmas\u0131 ile tan\u0131n\u0131r. \xc7ok duyarl\u0131 olan bu bur\xe7 insan\u0131 d\u0131\u015f etkenlerden \xe7ok kolayca etkilenebilir ve incinebilir. Hayal g\xfcc\xfc \xe7ok geli\u015fmi\u015f olmas\u0131 nedeniyle s\u0131k s\u0131k hayal d\xfcnyalar\u0131na s\u0131\u011f\u0131nabilirler. Bu \u015fekilde ger\xe7eklerden ka\xe7ma e\u011filimi ta\u015f\u0131rlar. Sevimli ve fedakar yap\u0131dad\u0131r. Mizah duygusu olan, sevilen arkada\u015flard\u0131r. Kendine g\xfcvensizlik bu burcun \xf6zelliklerinden biridir. Bal\u0131k burcu son derece artistik ve yarat\u0131c\u0131 \xf6zelliklere sahiptir."],t.s)
